import React from "react";
import MovieCarousel from "./MovieCarousel";
import MovieCard from "./MovieCard"; // Importar el componente MovieCard

function Main({ movies }) {
    return (
        <main>
            <>
                <MovieCarousel />
                <div className="flex flex-wrap">
                    {movies.map((movie, index) => (
                        <MovieCard key={index} movie={movie} /> // Renderizar MovieCard para cada película
                    ))}
                </div>
            </>
        </main>
    );
}

export default Main;
